import React from 'react';
import './TaskList.css';

function TaskList({ tasks }) {
  return (
    <ul className="task-list">
      {tasks.map((task, index) => (
        <li key={index} className="task-item">
          {task.title}
          {/* Add buttons for complete/delete later */}
        </li>
      ))}
    </ul>
  );
}

export default TaskList;
